import React from "react";
import "./Input.css";


const Input=(props)=>{
    return (
        <div>
        <form>
            <label>Username</label>
            <input type="text" />
            <label>Age</label>
            <input type="text" />
            <button type="submit" />
        </form>    
        </div>
    );
}

export default Input;
